    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000000838
  - id: NarrativeContent_20
    name: SECTION 4.4
    sectionNumber: '4.4'
    sectionTitle: Start of Trial and End of Trial
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000000839
  - id: NarrativeContent_21
